import React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { createStackNavigator } from '@react-navigation/stack';

import DashboardScreen from '../../Big Show OTT Super Admin Dashboard/src/screens/admin/AdminDashboardScreen';
import ContentManagementScreen from '../../Big Show OTT Super Admin Dashboard/src/screens/admin/ContentManagementScreen';
import SeriesScreen from '../../Big Show OTT Super Admin Dashboard/src/screens/admin/SeriesListScreen';
import SeasonsScreen from '../../Big Show OTT Super Admin Dashboard/src/screens/admin/SeasonsScreen';
import EpisodesScreen from '../../Big Show OTT Super Admin Dashboard/src/screens/admin/EpisodesScreen';
import UsersScreen from '../../Big Show OTT Super Admin Dashboard/src/screens/admin/UsersScreen';
import AnalyticsScreen from '../../Big Show OTT Super Admin Dashboard/src/screens/admin/AnalyticsScreen';

const Drawer = createDrawerNavigator();
const Stack = createStackNavigator();

const ContentStackNavigator = () => (
  <Stack.Navigator screenOptions={{ headerShown: false }}>
    <Stack.Screen name="ContentManagementHome" component={ContentManagementScreen} />
    <Stack.Screen name="SeriesList" component={SeriesScreen} />
    <Stack.Screen name="SeasonsList" component={SeasonsScreen} />
    <Stack.Screen name="EpisodesList" component={EpisodesScreen} />
  </Stack.Navigator>
);

const AdminNavigator = () => (
  <Drawer.Navigator initialRouteName="AdminDashboard" screenOptions={{ headerShown: true }}>
    <Drawer.Screen name="AdminDashboard" component={DashboardScreen} options={{ title: 'Dashboard' }}/>
    <Drawer.Screen name="ContentManagement" component={ContentStackNavigator} options={{ title: 'Content' }} />
    <Drawer.Screen name="Users" component={UsersScreen} options={{ title: 'Users' }} />
    <Drawer.Screen name="Analytics" component={AnalyticsScreen} options={{ title: 'Analytics' }} />
  </Drawer.Navigator>
);

export default AdminNavigator;
